INSERT INTO `wp_posts` VALUES (1,1,'2019-12-29 20:51:06','2019-12-29 20:51:06','<!-- wp:paragraph -->\n<p>Вступление</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Музыка в церкви - это средство поклонения Богу и развития искренних взаимоотношений с Ним.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Звучит просто и банально, и я думаю что приходя на богослужение мы не напоминаем себе такие вещи, потому что мы и рядом сидящие в них на 100 процентов уверены.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Музыка в церкви - это один из способов выражения и подтверждения библейских истин</strong>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Музыка в церкви - это художественное выражение и применение Богом данных талантов для Его же славы.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>&nbsp;</p>\n<!-- /wp:paragraph -->','Важность музыки в Церкви','','publish','open','open','','vazhnost-muziki-v-tserkvi','','','2020-01-09 17:34:03','2020-01-09 17:34:03','',0,'http://arrangemymusic.local/?p=1',0,'post','',0);
