INSERT INTO `wp_posts` VALUES (109,1,'2020-01-09 18:37:17','2020-01-09 18:37:17','<h2>Как аккомпанировать на слух на</h2>		\n			<h2>Фортепиано</h2>		\nВы выучились на пианиста. У вас есть музыкальный слух.&nbsp;Вы знаете теорию и гармонию. Вы поете в хоре или даже дирижируете.&nbsp;Но никак не поймете почему у вас не&nbsp;получается играть на слух.\nМы вам можем в этом помочь!		\n										<img width=\"1024\" height=\"768\" src=\"http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1024x768.jpg\" alt=\"\" srcset=\"http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1024x768.jpg 1024w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-300x225.jpg 300w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-768x576.jpg 768w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1536x1152.jpg 1536w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-2048x1536.jpg 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n										<img width=\"1024\" height=\"768\" src=\"http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1024x768.jpg\" alt=\"\" srcset=\"http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1024x768.jpg 1024w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-300x225.jpg 300w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-768x576.jpg 768w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1536x1152.jpg 1536w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-2048x1536.jpg 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n										<img width=\"1024\" height=\"768\" src=\"http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1024x768.jpg\" alt=\"\" srcset=\"http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1024x768.jpg 1024w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-300x225.jpg 300w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-768x576.jpg 768w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-1536x1152.jpg 1536w, http://arrangemymusic.local/wp-content/uploads/2020/01/piano-1-2048x1536.jpg 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n			<h2>Новости и обновления</h2>		\n		<p>Если вы желаете получать эту информацию регулярно, укажите свой электронный адрес.</p>','Homepage','','publish','closed','closed','','home','','','2020-01-09 20:46:32','2020-01-09 20:46:32','',0,'http://arrangemymusic.local/?page_id=109',0,'page','',0);
